import "./App.scss";
import Home from "./pages/home/Home";

import {BrowserRouter as Router, Switch, Route, Routes} from "react-router-dom";

const App = () => {
    return (
        <Routes>
            <Switch>
                <Route path="/">
                    <Home />
                </Route>
                <Route path="/movie">
                    <Home />
                </Route>
            </Switch>
        </Routes>
    );
};
export default App;
